import React from "react";
import AllyOffersLogo from "../AllyOffersLogo/AllyOffersLogo";
import account_icon from '../../images/account-icon.png';
import IconBubbleButton from "../IconBubbleButton/IconBubbleButton";
import styles from './PageHeader.css';

const PageHeader = () => {

    // bubble icons will be conditional based on screen
    // many components on this header will change 
    return (
        <div className='header'>
            <AllyOffersLogo/>
            
            <div className='bubble-buttons'>
                <IconBubbleButton/>
            </div>
        </div>
    );
};


export default PageHeader;
